var hikerGuard = (route, state) => {
  const authService = inject(AuthService);
  const router = inject(Router);
  return authService.userType$.pipe(take(1), map((userType) => {
    if (userType === "hiker") {
      return true;
    } else {
      router.navigate(["/"]);
      return false;
    }
  }));
};

